import React from 'react';

import cryptoComp from '../components/CryptoComponent.js';

function App() {

  const fetchAndLog = async () => {
    console.log("before API call ");
    const response = await fetch('/stock/value?function=CURRENCY_EXCHANGE_RATE&from_currency=BTC&to_currency=INR');
    console.log({ ...response });
    const json = await response.json();

    console.log(json);
  };

  return (
    <div>

      <cryptoComp />


    </div >
  );
}

export default App;
